export type Maybe<T> = T | null;
export type InputMaybe<T> = Maybe<T>;
export type Exact<T extends { [key: string]: unknown }> = { [K in keyof T]: T[K] };
export type MakeOptional<T, K extends keyof T> = Omit<T, K> & { [SubKey in K]?: Maybe<T[SubKey]> };
export type MakeMaybe<T, K extends keyof T> = Omit<T, K> & { [SubKey in K]: Maybe<T[SubKey]> };
export type MakeEmpty<T extends { [key: string]: unknown }, K extends keyof T> = { [_ in K]?: never };
export type Incremental<T> = T | { [P in keyof T]?: P extends ' $fragmentName' | '__typename' ? T[P] : never };
/** All built-in and custom scalars, mapped to their actual values */
export type Scalars = {
  ID: { input: string; output: string; }
  String: { input: string; output: string; }
  Boolean: { input: boolean; output: boolean; }
  Int: { input: number; output: number; }
  Float: { input: number; output: number; }
  BigFloat: { input: string; output: string; }
  BigInt: { input: unknown; output: unknown; }
  Cursor: { input: unknown; output: unknown; }
  Datetime: { input: string; output: string; }
  JSON: { input: any; output: any; }
};

/**
 * A condition to be used against `AaveFacilitator` object types. All fields are
 * tested for equality and combined with a logical ‘and.’
 */
export type AaveFacilitatorCondition = {
  /** Checks for equality with the object’s `id` field. */
  id?: InputMaybe<Scalars['String']['input']>;
  /** Checks for equality with the object’s `isRemoved` field. */
  isRemoved?: InputMaybe<Scalars['Boolean']['input']>;
  /** Checks for equality with the object’s `label` field. */
  label?: InputMaybe<Scalars['String']['input']>;
};

/** A filter to be used against `AaveFacilitator` object types. All fields are combined with a logical ‘and.’ */
export type AaveFacilitatorFilter = {
  /** Checks for all expressions in this list. */
  and?: InputMaybe<Array<AaveFacilitatorFilter>>;
  /** Filter by the object’s `id` field. */
  id?: InputMaybe<StringFilter>;
  /** Filter by the object’s `isRemoved` field. */
  isRemoved?: InputMaybe<BooleanFilter>;
  /** Filter by the object’s `label` field. */
  label?: InputMaybe<StringFilter>;
  /** Negates the expression. */
  not?: InputMaybe<AaveFacilitatorFilter>;
  /** Checks for any expressions in this list. */
  or?: InputMaybe<Array<AaveFacilitatorFilter>>;
};

/** Grouping methods for `AaveFacilitator` for usage during aggregation. */
export enum AaveFacilitatorGroupBy {
  IsRemoved = 'IS_REMOVED',
  Label = 'LABEL'
}

